import React from "react";

const UserSingle = (props) => {
    return ( 
        <div classname="row">
            <div classname="col s12">
            <div classname="card">
                <div classname="card-image">
                    <span classname="card-title">{props.user.name}</span>
                </div>
            </div>
            </div>
        </div>
    );
}

export default UserSingle;
